INSERT INTO `movies` (`id`, `title`, `description`, `avatar`, `year`, `duration`, `rate`, `rank`, `directors`, `actors`) VALUES
	('tt0021749', 'City Lights', 'With the aid of a wealthy erratic tippler, a dewy-eyed tramp who has fallen in love with a sightless flower girl accumulates money to be able to help her medically.', 'https://m.media-amazon.com/images/M/MV5BY2I4MmM1N2EtM2YzOS00OWUzLTkzYzctNDc5NDg2N2IyODJmXkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_.jpg', '1931', '1H 27M', 8.5, 54, 'Charles Chaplin', 'Charles Chaplin, Virginia Cherrill, Florence Lee'),
	('tt0027977', 'Modern Times', 'The Tramp struggles to live in modern industrial society with the help of a young homeless woman.', 'https://m.media-amazon.com/images/M/MV5BM2VlMjY3N2UtN2ZjNC00MDg4LWI3ZGQtZmE4NjZkZjkwZmYzXkEyXkFqcGdeQXVyMTU3NDU4MDg2._V1_.jpg', '1936', '1H 27M', 8.5, 50, 'Charles Chaplin', 'Charles Chaplin, Paulette Goddard, Henry Bergman'),
	('tt0032553', 'The Great Dictator', 'Dictator Adenoid Hynkel tries to expand his empire while a poor Jewish barber tries to avoid persecution from Hynkel&apos;s regime.', 'https://m.media-amazon.com/images/M/MV5BMjc4ZjEwNDUtMjlmZS00NzQ4LTg2N2MtMGI3ZjMyMmM3ZDM2XkEyXkFqcGc@._V1_.jpg', '1941', '2H 5M', 8.4, 68, 'Charles Chaplin', 'Charles Chaplin, Paulette Goddard, Jack Oakie'),
	('tt0034583', 'Casablanca', 'A cynical expatriate American cafe owner struggles to decide whether or not to help his former lover and her fugitive husband escape the Nazis in French Morocco.', 'https://m.media-amazon.com/images/M/MV5BY2IzZGY2YmEtYzljNS00NTM5LTgwMzUtMzM1NjQ4NGI0OTk0XkEyXkFqcGdeQXVyNDYyMDk5MTU@._V1_.jpg', '1943', '1H 42M', 8.5, 47, 'Michael Curtiz', 'Humphrey Bogart, Ingrid Bergman, Paul Henreid'),
	('tt0038650', 'It&apos;s a Wonderful Life', 'An angel is sent from Heaven to help a desperately frustrated businessman by showing him what life would have been like if he had never existed.', 'https://m.media-amazon.com/images/M/MV5BZjc4NDZhZWMtNGEzYS00ZWU2LThlM2ItNTA0YzQ0OTExMTE2XkEyXkFqcGdeQXVyNjUwMzI2NzU@._V1_.jpg', '1947', '2H 10M', 8.6, 21, 'Frank Capra', 'James Stewart, Donna Reed, Lionel Barrymore'),
	('tt0043014', 'Sunset Blvd.', 'A screenwriter develops a dangerous relationship with a faded film star determined to make a triumphant return.', 'https://m.media-amazon.com/images/M/MV5BMTU0NTkyNzYwMF5BMl5BanBnXkFtZTgwMDU0NDk5MTI@._V1_.jpg', '1950', '1H 50M', 8.4, 62, 'Billy Wilder', 'William Holden, Gloria Swanson, Erich von Stroheim'),
	('tt0044741', 'Ikiru', 'A bureaucrat tries to find meaning in his life after he discovers he has terminal cancer.', 'https://m.media-amazon.com/images/M/MV5BYWM1YmZkNTctZDAwNy00ZTY4LWFjMTktYzU4ZjViMmU1OTJmXkEyXkFqcGdeQXVyMTA0MTM5NjI2._V1_.jpg', '1952', '2H 23M', 8.3, 98, 'Akira Kurosawa', 'Takashi Shimura, Nobuo Kaneko, Shin&apos;ichi Himori'),
	('tt0045152', 'Singin&apos; in the Rain', 'A silent film star falls for a chorus girl just as he and his delusionally jealous screen partner are trying to make the difficult transition to talking pictures in 1920s Hollywood.', 'https://m.media-amazon.com/images/M/MV5BZDRjNGViMjQtOThlMi00MTA3LThkYzQtNzJkYjBkMGE0YzE1XkEyXkFqcGdeQXVyNDYyMDk5MTU@._V1_.jpg', '1956', '1H 43M', 8.3, 88, 'Stanley Donen, Gene Kelly', 'Gene Kelly, Donald O&apos;Connor, Debbie Reynolds'),
	('tt0047396', 'Rear Window', 'A wheelchair-bound photographer spies on his neighbors from his Greenwich Village courtyard apartment window and, despite the skepticism of his fashion-model girlfriend, becomes convinced one of them has committed murder.', 'https://m.media-amazon.com/images/M/MV5BNGUxYWM3M2MtMGM3Mi00ZmRiLWE0NGQtZjE5ODI2OTJhNTU0XkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_.jpg', '1954', '1H 52M', 8.5, 51, 'Alfred Hitchcock', 'James Stewart, Grace Kelly, Wendell Corey'),
	('tt0047478', 'Shichinin no samurai', 'Farmers from a village exploited by bandits hire a veteran samurai for protection, who gathers six other samurai to join him.', 'https://m.media-amazon.com/images/M/MV5BNTkwY2I5NWMtMjNlNi00ZThjLWI4NzQtNDI4M2I4OGM1YjAzXkEyXkFqcGdeQXVyNzYxODE3NTQ@._V1_.jpg', '1954', '3H 27M', 8.6, 22, 'Akira Kurosawa', 'Toshirô Mifune, Takashi Shimura, Keiko Tsushima'),
	('tt0050083', '12 Angry Men', 'The jury in a New York City murder trial is frustrated by a single member whose skeptical caution forces them to more carefully consider the evidence before jumping to a hasty verdict.', 'https://m.media-amazon.com/images/M/MV5BMWU4N2FjNzYtNTVkNC00NzQ0LTg0MjAtYTJlMjFhNGUxZDFmXkEyXkFqcGdeQXVyNjc1NTYyMjg@._V1_.jpg', '1957', '1H 36M', 9, 5, 'Sidney Lumet', 'Henry Fonda, Lee J. Cobb, Martin Balsam'),
	('tt0050825', 'Paths of Glory', 'After a failed attack on a German position, a general orders three soldiers, chosen at random, court-martialed for cowardice and their commanding officer must defend them.', 'https://m.media-amazon.com/images/M/MV5BOTI5Nzc0OTMtYzBkMS00NjkxLThmM2UtNjM2ODgxN2M5NjNkXkEyXkFqcGdeQXVyNjQ2MjQ5NzM@._V1_.jpg', '1957', '1H 28M', 8.4, 64, 'Stanley Kubrick', 'Kirk Douglas, Ralph Meeker, Adolphe Menjou'),
	('tt0051201', 'Witness for the Prosecution', 'A veteran British barrister must defend his client in a murder trial that has surprise after surprise.', 'https://m.media-amazon.com/images/M/MV5BNDQwODU5OWYtNDcyNi00MDQ1LThiOGMtZDkwNWJiM2Y3MDg0XkEyXkFqcGdeQXVyMDI2NDg0NQ@@._V1_.jpg', '1958', '1H 56M', 8.4, 66, 'Billy Wilder', 'Tyrone Power, Marlene Dietrich, Charles Laughton'),
	('tt0054215', 'Psycho', 'A secretary on the run for embezzlement takes refuge at a secluded California motel owned by a repressed man and his overbearing mother.', 'https://m.media-amazon.com/images/M/MV5BNTQwNDM1YzItNDAxZC00NWY2LTk0M2UtNDIwNWI5OGUyNWUxXkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_.jpg', '1960', '1H 49M', 8.5, 35, 'Alfred Hitchcock', 'Anthony Perkins, Janet Leigh, Vera Miles'),
	('tt0056058', 'Seppuku', 'When a ronin requesting seppuku at a feudal lord&apos;s palace is told of the brutal suicide of another ronin who previously visited, he reveals how their pasts are intertwined - and in doing so challenges the clan&apos;s integrity.', 'https://m.media-amazon.com/images/M/MV5BMWNmYzg5NWYtNzhiMS00NzlkLTgyOTUtYzM3MjY0NDc2YjFkXkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_.jpg', '1962', '2H 13M', 8.6, 45, 'Masaki Kobayashi', 'Tatsuya Nakadai, Akira Ishihama, Shima Iwashita'),
	('tt0056172', 'Lawrence of Arabia', 'The story of T.E. Lawrence, the English officer who successfully united and led the diverse, often warring, Arab tribes during World War I in order to fight the Turks.', 'https://m.media-amazon.com/images/M/MV5BNDY4ZWE2YjUtZjQ5MS00ZTQ0LTkxODYtNDFkOTExZGI2YjlhXkEyXkFqcGdeQXVyMjc1Njc4Mzk@._V1_.jpg', '1962', '3H 38M', 8.3, 100, 'David Lean', 'Peter O&apos;Toole, Alec Guinness, Anthony Quinn'),
	('tt0057012', 'Dr. Strangelove or: How I Learned to Stop Worrying and Love the Bomb', 'An unhinged American general orders a bombing attack on the Soviet Union, triggering a path to nuclear holocaust that a war room full of politicians and generals frantically tries to stop.', 'https://m.media-amazon.com/images/M/MV5BZWI3ZTMxNjctMjdlNS00NmUwLWFiM2YtZDUyY2I3N2MxYTE0XkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_.jpg', '1964', '1H 35M', 8.3, 72, 'Stanley Kubrick', 'Peter Sellers, George C. Scott, Sterling Hayden'),
	('tt0057565', 'Tengoku to jigoku', 'An executive of a Yokohama shoe company becomes a victim of extortion when his chauffeur&apos;s son is kidnapped by mistake and held for ransom.', 'https://m.media-amazon.com/images/M/MV5BZGQ1NWZlYjctNDJmOS00MmU2LTg1ODItNmZiM2ZkNzJhNDI0XkEyXkFqcGdeQXVyNjc1NTYyMjg@._V1_.jpg', '1963', '2H 23M', 8.4, 85, 'Akira Kurosawa', 'Toshirô Mifune, Yutaka Sada, Tatsuya Nakadai'),
	('tt0060196', 'Il buono, il brutto, il cattivo', 'A bounty hunting scam joins two men in an uneasy alliance against a third in a race to find a fortune in gold buried in a remote cemetery.', 'https://m.media-amazon.com/images/M/MV5BODc3N2ViMDUtNzEzNS00NTZjLWE0MmMtZDc5ZTk2MTU4ZWFmXkEyXkFqcGdeQXVyMjc1Njc4Mzk@._V1_.jpg', '1966', '2H 41M', 8.8, 10, 'Sergio Leone', 'Clint Eastwood, Eli Wallach, Lee Van Cleef'),
	('tt0062622', '2001: A Space Odyssey', 'After uncovering a mysterious artifact buried beneath the Lunar surface, a spacecraft is sent to Jupiter to find its origins: a spacecraft manned by two men and the supercomputer HAL 9000.', 'https://m.media-amazon.com/images/M/MV5BNmNlNWJlOGQtZTRjNy00Y2Y0LTk5MWMtNWE0N2JhZmExMTZlXkEyXkFqcGdeQXVyMTM5OTg3MTQ@._V1_.jpg', '1968', '2H 29M', 8.3, 96, 'Stanley Kubrick', 'Keir Dullea, Gary Lockwood, William Sylvester'),
	('tt0064116', 'C&apos;era una volta il West', 'A mysterious stranger with a harmonica joins forces with a notorious desperado to protect a beautiful widow from a ruthless assassin working for the railroad.', 'https://m.media-amazon.com/images/M/MV5BNWNlZDU2M2YtNjU5Yi00NWU5LWI4ZjYtM2RkNzhkYjIyMmI2XkEyXkFqcGdeQXVyMTM5OTg3MTQ@._V1_.jpg', '1969', '2H 46M', 8.5, 52, 'Sergio Leone', 'Henry Fonda, Charles Bronson, Claudia Cardinale'),
	('tt0068646', 'The Godfather', 'The aging patriarch of an organized crime dynasty transfers control of his clandestine empire to his reluctant son.', 'https://m.media-amazon.com/images/M/MV5BM2MyNjYxNmUtYTAwNi00MTYxLWJmNWYtYzZlODY3ZTk3OTFlXkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_.jpg', '1972', '2H 55M', 9.2, 2, 'Francis Ford Coppola', 'Marlon Brando, Al Pacino, James Caan'),
	('tt0071562', 'The Godfather Part II', 'The early life and career of Vito Corleone in 1920s New York City is portrayed, while his son, Michael, expands and tightens his grip on the family crime syndicate.', 'https://m.media-amazon.com/images/M/MV5BMWMwMGQzZTItY2JlNC00OWZiLWIyMDctNDk2ZDQ2YjRjMWQ0XkEyXkFqcGdeQXVyNzkwMjQ5NzM@._V1_.jpg', '1974', '3H 22M', 9, 4, 'Francis Ford Coppola', 'Al Pacino, Robert De Niro, Robert Duvall'),
	('tt0073486', 'One Flew Over the Cuckoo&apos;s Nest', 'In the Fall of 1963, a Korean War veteran and criminal pleads insanity and is admitted to a mental institution, where he rallies up the scared patients against the tyrannical nurse.', 'https://m.media-amazon.com/images/M/MV5BZjA0OWVhOTAtYWQxNi00YzNhLWI4ZjYtNjFjZTEyYjJlNDVlL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_.jpg', '1975', '2H 13M', 8.7, 18, 'Milos Forman', 'Jack Nicholson, Louise Fletcher, Michael Berryman'),
