	('tt0338013', 'Eternal Sunshine of the Spotless Mind', 'When their relationship turns sour, a couple undergoes a medical procedure to have each other erased from their memories forever.', 'https://m.media-amazon.com/images/M/MV5BMTY4NzcwODg3Nl5BMl5BanBnXkFtZTcwNTEwOTMyMw@@._V1_.jpg', '2004', '1H 48M', 8.3, 94, 'Michel Gondry', 'Jim Carrey, Kate Winslet, Tom Wilkinson'),
	('tt0361748', 'Inglourious Basterds', 'In Nazi-occupied France during World War II, a plan to assassinate Nazi leaders by a group of Jewish U.S. soldiers coincides with a theatre owner&apos;s vengeful plans for the same.', 'https://m.media-amazon.com/images/M/MV5BOTJiNDEzOWYtMTVjOC00ZjlmLWE0NGMtZmE1OWVmZDQ2OWJhXkEyXkFqcGdeQXVyNTIzOTk5ODM@._V1_.jpg', '2009', '2H 33M', 8.4, 70, 'Quentin Tarantino', 'Brad Pitt, Diane Kruger, Eli Roth'),
	('tt0364569', 'Oldeuboi', 'After being kidnapped and imprisoned for fifteen years, Oh Dae-Su is released, only to find that he must track down his captor in five days.', 'https://m.media-amazon.com/images/M/MV5BMTI3NTQyMzU5M15BMl5BanBnXkFtZTcwMTM2MjgyMQ@@._V1_.jpg', '2003', '2H', 8.3, 74, 'Park Chan-wook', 'Choi Min-sik, Yoo Ji-tae, Kang Hye-jeong'),
	('tt0405094', 'Das Leben der Anderen', 'In 1984 East Berlin, an agent of the secret police conducting surveillance on a writer and his lover finds himself becoming increasingly absorbed by their lives.', 'https://m.media-amazon.com/images/M/MV5BNmQyNmJjM2ItNTQzYi00ZjMxLWFjMDYtZjUyN2YwZDk5YWQ2XkEyXkFqcGdeQXVyMjUzOTY1NTc@._V1_.jpg', '2006', '2H 17M', 8.4, 61, 'Florian Henckel von Donnersmarck', 'Ulrich Mühe, Martina Gedeck, Sebastian Koch'),
	('tt0407887', 'The Departed', 'An undercover cop and a mole in the police attempt to identify each other while infiltrating an Irish gang in South Boston.', 'https://m.media-amazon.com/images/M/MV5BMTI1MTY2OTIxNV5BMl5BanBnXkFtZTYwNjQ4NjY3._V1_.jpg', '2006', '2H 31M', 8.5, 39, 'Martin Scorsese', 'Leonardo DiCaprio, Matt Damon, Jack Nicholson'),
	('tt0435761', 'Toy Story 3', 'The toys are mistakenly delivered to a day-care center instead of the attic right before Andy leaves for college, and it&apos;s up to Woody to convince the other toys that they weren&apos;t abandoned and to return home.', 'https://m.media-amazon.com/images/M/MV5BMTgxOTY4Mjc0MF5BMl5BanBnXkFtZTcwNTA4MDQyMw@@._V1_.jpg', '2011', '1H 43M', 8.3, 92, 'Lee Unkrich', 'Tom Hanks, Tim Allen, Joan Cusack'),
	('tt0468569', 'The Dark Knight', 'When the menace known as the Joker wreaks havoc and chaos on the people of Gotham, Batman must accept one of the greatest psychological and physical tests of his ability to fight injustice.', 'https://m.media-amazon.com/images/M/MV5BMTMxNTMwODM0NF5BMl5BanBnXkFtZTcwODAyMTk2Mw@@._V1_.jpg', '2008', '2H 32M', 9, 3, 'Christopher Nolan', 'Christian Bale, Heath Ledger, Aaron Eckhart'),
	('tt0482571', 'The Prestige', 'After a tragic accident, two stage magicians in 1890s London engage in a battle to create the ultimate illusion while sacrificing everything they have to outwit each other.', 'https://m.media-amazon.com/images/M/MV5BMjA4NDI0MTIxNF5BMl5BanBnXkFtZTYwNTM0MzY2._V1_.jpg', '2006', '2H 10M', 8.5, 43, 'Christopher Nolan', 'Christian Bale, Hugh Jackman, Scarlett Johansson'),
	('tt0816692', 'Interstellar', 'When Earth becomes uninhabitable in the future, a farmer and ex-NASA pilot, Joseph Cooper, is tasked to pilot a spacecraft, along with a team of researchers, to find a new planet for humans.', 'https://m.media-amazon.com/images/M/MV5BZjdkOTU3MDktN2IxOS00OGEyLWFmMjktY2FiMmZkNWIyODZiXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_.jpg', '2014', '2H 49M', 8.7, 20, 'Christopher Nolan', 'Matthew McConaughey, Anne Hathaway, Jessica Chastain'),
	('tt0910970', 'WALL·E', 'In the distant future, a small waste-collecting robot inadvertently embarks on a space journey that will ultimately decide the fate of mankind.', 'https://m.media-amazon.com/images/M/MV5BMjExMTg5OTU0NF5BMl5BanBnXkFtZTcwMjMxMzMzMw@@._V1_.jpg', '2009', '1H 38M', 8.4, 58, 'Andrew Stanton', 'Ben Burtt, Elissa Knight, Jeff Garlin'),
	('tt11152168', 'IF', 'A young girl who goes through a difficult experience begins to see everyone&apos;s imaginary friends who have been left behind as their real-life friends have grown up.', 'https://m.media-amazon.com/images/M/MV5BYWQ4OGI2MmQtZjUxMC00Njg2LWJiZTQtYmFmZjI5ZmI1Y2U1XkEyXkFqcGdeQXVyMTA1NjE5MTAz._V1_.jpg', '2024', '1H 44M', 6.7, 103, 'John Krasinski', 'Cailey Fleming, Ryan Reynolds, John Krasinski'),
	('tt11389872', 'Kingdom of the Planet of the Apes', 'Many years after the reign of Caesar, a young ape goes on a journey that will lead him to question everything he&apos;s been taught about the past and make choices that will define a future for apes and humans alike.', 'https://m.media-amazon.com/images/M/MV5BZGI4NTEwNTAtZDcwMi00MDkxLTg1OGYtNTZmMzE3ZDljNzVlXkEyXkFqcGdeQXVyMTEyMjM2NDc2._V1_.jpg', '2024', '2H 25M', 7.2, 105, 'Wes Ball', 'Owen Teague, Freya Allan, Kevin Durand'),
	('tt1187043', '3 Idiots', 'Two friends are searching for their long lost companion. They revisit their college days and recall the memories of their friend who inspired them to think differently, even as the rest of the world called them &quot;idiots&quot;.', 'https://m.media-amazon.com/images/M/MV5BNTkyOGVjMGEtNmQzZi00NzFlLTlhOWQtODYyMDc2ZGJmYzFhXkEyXkFqcGdeQXVyNjU0OTQ0OTY@._V1_.jpg', '2009', '2H 50M', 8.4, 87, 'Rajkumar Hirani', 'Aamir Khan, Madhavan, Mona Singh'),
	('tt12037194', 'Furiosa: A Mad Max Saga', 'The origin story of renegade warrior Furiosa before her encounter and teamup with Mad Max.', 'https://m.media-amazon.com/images/M/MV5BNmYzMWVjNmQtNjJjNy00M2Y4LTkzZjQtZWQ5NmYzMjRjMDIzXkEyXkFqcGdeQXVyMTM1NjM2ODg1._V1_.jpg', '2024', '2H 28M', 7.8, 106, 'George Miller', 'Anya Taylor-Joy, Chris Hemsworth, Tom Burke'),
	('tt1345836', 'The Dark Knight Rises', 'Eight years after the Joker&apos;s reign of chaos, Batman is coerced out of exile with the assistance of the mysterious Selina Kyle in order to defend Gotham City from the vicious guerrilla terrorist Bane.', 'https://m.media-amazon.com/images/M/MV5BMTk4ODQzNDY3Ml5BMl5BanBnXkFtZTcwODA0NTM4Nw@@._V1_.jpg', '2012', '2H 44M', 8.4, 71, 'Christopher Nolan', 'Christian Bale, Tom Hardy, Anne Hathaway'),
	('tt1375666', 'Inception', 'A thief who steals corporate secrets through the use of dream-sharing technology is given the inverse task of planting an idea into the mind of a C.E.O., but his tragic past may doom the project and his team to disaster.', 'https://m.media-amazon.com/images/M/MV5BMjAxMzY3NjcxNF5BMl5BanBnXkFtZTcwNTI5OTM0Mw@@._V1_.jpg', '2010', '2H 28M', 8.8, 14, 'Christopher Nolan', 'Leonardo DiCaprio, Joseph Gordon-Levitt, Elliot Page'),
	('tt15239678', 'Dune: Part Two', 'Paul Atreides unites with Chani and the Fremen while seeking revenge against the conspirators who destroyed his family.', 'https://m.media-amazon.com/images/M/MV5BN2QyZGU4ZDctOWMzMy00NTc5LThlOGQtODhmNDI1NmY5YzAwXkEyXkFqcGdeQXVyMDM2NDM2MQ@@._V1_.jpg', '2024', '2H 46M', 8.6, 31, 'Denis Villeneuve', 'Timothée Chalamet, Zendaya, Rebecca Ferguson'),
	('tt15398776', 'Oppenheimer', 'The story of American scientist J. Robert Oppenheimer and his role in the development of the atomic bomb.', 'https://m.media-amazon.com/images/M/MV5BMDBmYTZjNjUtN2M1MS00MTQ2LTk2ODgtNzc2M2QyZGE5NTVjXkEyXkFqcGdeQXVyNzAwMjU2MTY@._V1_.jpg', '2023', '3H', 8.3, 99, 'Christopher Nolan', 'Cillian Murphy, Emily Blunt, Matt Damon'),
	('tt1675434', 'Intouchables', 'After he becomes a quadriplegic from a paragliding accident, an aristocrat hires a young man from the projects to be his caregiver.', 'https://m.media-amazon.com/images/M/MV5BMTYxNDA3MDQwNl5BMl5BanBnXkFtZTcwNTU4Mzc1Nw@@._V1_.jpg', '2011', '1H 52M', 8.5, 48, 'Olivier Nakache, Éric Toledano', 'François Cluzet, Omar Sy, Anne Le Ny'),
	('tt1684562', 'The Fall Guy', 'A down-and-out stuntman must find the missing star of his ex-girlfriend&apos;s blockbuster film.', 'https://m.media-amazon.com/images/M/MV5BMjA5ZjA3ZjMtMzg2ZC00ZDc4LTk3MTctYTE1ZTUzZDIzMjQyXkEyXkFqcGdeQXVyMTM1NjM2ODg1._V1_.jpg', '2024', '2H 6M', 7, 107, 'David Leitch', 'Ryan Gosling, Emily Blunt, Aaron Taylor-Johnson'),
	('tt1853728', 'Django Unchained', 'With the help of a German bounty-hunter, a freed slave sets out to rescue his wife from a brutal plantation owner in Mississippi.', 'https://m.media-amazon.com/images/M/MV5BMjIyNTQ5NjQ1OV5BMl5BanBnXkFtZTcwODg1MDU4OA@@._V1_.jpg', '2012', '2H 45M', 8.5, 55, 'Quentin Tarantino', 'Jamie Foxx, Christoph Waltz, Leonardo DiCaprio'),
	('tt2106476', 'Jagten', 'A teacher lives a lonely life, all the while struggling over his son&apos;s custody. His life slowly gets better as he finds love and receives good news from his son, but his new luck is about to be brutally shattered by an innocent li...', 'https://m.media-amazon.com/images/M/MV5BMTg2NDg3ODg4NF5BMl5BanBnXkFtZTcwNzk3NTc3Nw@@._V1_.jpg', '2013', '1H 55M', 8.3, 95, 'Thomas Vinterberg', 'Mads Mikkelsen, Thomas Bo Larsen, Annika Wedderkopp'),
	('tt22050754', 'The Strangers: Chapter 1', 'After their car breaks down in an eerie small town, a young couple is forced to spend the night in a remote cabin. Panic ensues as they are terrorized by three masked strangers who strike with no mercy and seemingly no motive.', 'https://m.media-amazon.com/images/M/MV5BNDVkZTM0NDAtNTQxMS00NWIyLTgyM2ItNjAxOTllYTAzNTVjXkEyXkFqcGdeQXVyMjM4NTM5NDY@._V1_.jpg', '2024', '1H 31M', 4.7, 110, 'Renny Harlin', 'Madelaine Petsch, Ryan Bown, Matus Lajcak'),
	('tt2380307', 'Coco', 'Aspiring musician Miguel, confronted with his family&apos;s ancestral ban on music, enters the Land of the Dead to find his great-great-grandfather, a legendary singer.', 'https://m.media-amazon.com/images/M/MV5BYjQ5NjM0Y2YtNjZkNC00ZDhkLWJjMWItN2QyNzFkMDE3ZjAxXkEyXkFqcGdeQXVyODIxMzk5NjA@._V1_.jpg', '2017', '1H 45M', 8.4, 73, 'Lee Unkrich, Adrian Molina', 'Anthony Gonzalez, Gael García Bernal, Benjamin Bratt'),
	('tt23849204', '12th Fail', 'The real-life story of IPS Officer Manoj Kumar Sharma and IRS Officer Shraddha Joshi.', 'https://m.media-amazon.com/images/M/MV5BZDI4OTM1ZjMtOWQxMC00OTY5LTg3NjQtMjlhMWVjODFlYTY4XkEyXkFqcGdeQXVyMTYzMTU3Njgx._V1_.jpg', '2023', '2H 27M', 8.9, 59, 'Vidhu Vinod Chopra', 'Vikrant Massey, Medha Shankr, Anant Joshi'),
	('tt2582802', 'Whiplash', 'A promising young drummer enrolls at a cut-throat music conservatory where his dreams of greatness are mentored by an instructor who will stop at nothing to realize a student&apos;s potential.', 'https://m.media-amazon.com/images/M/MV5BOTA5NDZlZGUtMjAxOS00YTRkLTkwYmMtYWQ0NWEwZDZiNjEzXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_.jpg', '2014', '1H 46M', 8.5, 42, 'Damien Chazelle', 'Miles Teller, J.K. Simmons, Melissa Benoist'),
	('tt26736843', 'The Watchers', 'A young artist gets stranded in an extensive, immaculate forest in western Ireland, where, after finding shelter, she becomes trapped alongside three strangers, stalked by mysterious creatures each night.', 'https://m.media-amazon.com/images/M/MV5BZjNlYjg5YzYtMmU4ZC00MzA4LWE5YWYtNTJlOTkyZmQ0YzdkXkEyXkFqcGdeQXVyMTkxNjUyNQ@@._V1_.jpg', '2024', '1H 42M', 5.8, 104, 'Ishana Shyamalan', 'Dakota Fanning, Georgina Campbell, Olwen Fouéré'),
	('tt4154756', 'Avengers: Infinity War', 'The Avengers and their allies must be willing to sacrifice all in an attempt to defeat the powerful Thanos before his blitz of devastation and ruin puts an end to the universe.', 'https://m.media-amazon.com/images/M/MV5BMjMxNjY2MDU1OV5BMl5BanBnXkFtZTgwNzY1MTUwNTM@._V1_.jpg', '2018', '2H 29M', 8.4, 63, 'Anthony Russo, Joe Russo', 'Robert Downey Jr., Chris Hemsworth, Mark Ruffalo'),
	('tt4154796', 'Avengers: Endgame', 'After the devastating events of Avengers: Infinity War (2018), the universe is in ruins. With the help of remaining allies, the Avengers assemble once more in order to reverse Thanos&apos; actions and restore balance to the universe.', 'https://m.media-amazon.com/images/M/MV5BMTc5MDE2ODcwNV5BMl5BanBnXkFtZTgwMzI2NzQ2NzM@._V1_.jpg', '2019', '3H 1M', 8.4, 78, 'Anthony Russo, Joe Russo', 'Robert Downey Jr., Chris Evans, Mark Ruffalo'),
	('tt4633694', 'Spider-Man: Into the Spider-Verse', 'Teen Miles Morales becomes the Spider-Man of his universe and must join with five spider-powered individuals from other dimensions to stop a threat for all realities.', 'https://m.media-amazon.com/images/M/MV5BMjMwNDkxMTgzOF5BMl5BanBnXkFtZTgwNTkwNTQ3NjM@._V1_.jpg', '2018', '1H 57M', 8.4, 65, 'Bob Persichetti, Peter Ramsey, Rodney Rothman', 'Shameik Moore, Jake Johnson, Hailee Steinfeld'),
	('tt4919268', 'Bad Boys: Ride or Die', 'This Summer, the world&apos;s favorite Bad Boys are back with their iconic mix of edge-of-your seat action and outrageous comedy but this time with a twist: Miami&apos;s finest are now on the run.', 'https://m.media-amazon.com/images/M/MV5BY2U5YmQ3YjgtM2I2OC00YmM5LTkyM2MtN2I5Zjg2MDE0ODkwXkEyXkFqcGdeQXVyMDM2NDM2MQ@@._V1_.jpg', '2024', '1H 55M', 7, 101, 'Adil El Arbi, Bilall Fallah', 'Will Smith, Martin Lawrence, Vanessa Hudgens'),
	('tt5311514', 'Kimi no na wa.', 'Two teenagers share a profound, magical connection upon discovering they are swapping bodies. Things manage to become even more complicated when the boy and girl decide to meet in person.', 'https://m.media-amazon.com/images/M/MV5BODRmZDVmNzUtZDA4ZC00NjhkLWI2M2UtN2M0ZDIzNDcxYThjL2ltYWdlXkEyXkFqcGdeQXVyNTk0MzMzODA@._V1_.jpg', '2016', '1H 46M', 8.4, 84, 'Makoto Shinkai', 'Ryunosuke Kamiki, Mone Kamishiraishi, Ryo Narita'),
	('tt5779228', 'The Garfield Movie', 'After Garfield&apos;s unexpected reunion with his long-lost father, ragged alley cat Vic, he and his canine friend Odie are forced from their perfectly pampered lives to join Vic on a risky heist.', 'https://m.media-amazon.com/images/M/MV5BZDdlNTIwNjYtNzVhNS00MGVmLTk1ZGYtZmZiMjhiMmQ1ZjkwXkEyXkFqcGdeQXVyMTY3ODkyNDkz._V1_.jpg', '2024', '1H 41M', 5.8, 102, 'Mark Dindal', 'Chris Pratt, Samuel L. Jackson, Hannah Waddingham'),
	('tt6751668', 'Gisaengchung', 'Greed and class discrimination threaten the newly-formed symbiotic relationship between the wealthy Park family and the destitute Kim clan.', 'https://m.media-amazon.com/images/M/MV5BYWZjMjk3ZTItODQ2ZC00NTY5LWE0ZDYtZTI3MjcwN2Q5NTVkXkEyXkFqcGdeQXVyODk4OTc3MTY@._V1_.jpg', '2019', '2H 12M', 8.5, 34, 'Bong Joon Ho', 'Song Kang-ho, Lee Sun-kyun, Cho Yeo-jeong'),
	('tt7286456', 'Joker', 'During the 1980s, a failed stand-up comedian is driven insane and turns to a life of crime and chaos in Gotham City while becoming an infamous psychopathic crime figure.', 'https://m.media-amazon.com/images/M/MV5BNGVjNWI4ZGUtNzE0MS00YTJmLWE0ZDctN2ZiYTk2YmI3NTYyXkEyXkFqcGdeQXVyMTkxNjUyNQ@@._V1_.jpg', '2019', '2H 2M', 8.4, 83, 'Todd Phillips', 'Joaquin Phoenix, Robert De Niro, Zazie Beetz'),
	('tt8267604', 'Capharnaüm', 'While serving a five-year sentence for a violent crime, a 12-year-old boy sues his parents for neglect.', 'https://m.media-amazon.com/images/M/MV5BMmExNzU2ZWMtYzUwYi00YmM2LTkxZTQtNmVhNjY0NTMyMWI2XkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_.jpg', '2019', '2H 6M', 8.4, 89, 'Nadine Labaki', 'Zain Al Rafeea, Yordanos Shiferaw, Boluwatife Treasure Bankole'),
	('tt9362722', 'Spider-Man: Across the Spider-Verse', 'Miles Morales catapults across the multiverse, where he encounters a team of Spider-People charged with protecting its very existence. When the heroes clash on how to handle a new threat, Miles must redefine what it means to be a hero.', 'https://m.media-amazon.com/images/M/MV5BMzI0NmVkMjEtYmY4MS00ZDMxLTlkZmEtMzU4MDQxYTMzMjU2XkEyXkFqcGdeQXVyMzQ0MzA0NTM@._V1_.jpg', '2023', '2H 20M', 8.6, 37, 'Joaquim Dos Santos, Kemp Powers, Justin K. Thompson', 'Shameik Moore, Hailee Steinfeld, Brian Tyree Henry');
